import React, { FC, useState, useEffect, useCallback } from "react";
import { toast } from "react-toastify";
import { Button, Grid, AppBar, Box, Toolbar, IconButton, Typography } from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";
import "react-toastify/dist/ReactToastify.css";
import "./styles.css";

const Home = () => {

  return (
    <div>
      <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Frameworks
          </Typography>
          <Button color="inherit" variant="contained">Add Task</Button>
        </Toolbar>
      </AppBar>
      </Box>
    </div>
  );
};

export default Home;
